import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";

const ForData = () => {
  return (
    <div>
      <Container>
        <Row>
          <Col>
            <Card>
              <Card.Body></Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default ForData;
